class Node:    def __init__(self, data):        self.data = data        self.next = Noneclass LinkedList:    def __init__(self):        self.head = None    # datani oxirgisiga qo'shadi    def append(self, data):        new_node = Node(data)        if self.head is None:            self.head = new_node            return        last_node = self.head        while last_node.next:            last_node = last_node.next        last_node.next = new_node    # datani birinchisiga qo'shadi    def prepand(self, data):        new_node = Node(data)        if self.head is None:            self.head = new_node            return        new_node.next = self.head        self.head = new_node    def get_all(self):        ls = []        cur = self.head        while cur.next:            ls.append(cur.data)            cur = cur.next        ls.append(cur.data)        print(ls)llist = LinkedList()llist.append(1)llist.append(2)llist.append(3)llist.append(4)llist.prepand(5)# print(llist.head.next.data)llist.get_all()